import React, { useState, useContext } from 'react';
import Link from "next/link";
import Router from 'next/router'
import { MainContext, MainConsumer } from "../components/contextProviders/MainContext"
import {Wrapper} from "../components/StyledComponents/Wrapper";
import {ButtonWithIcon} from "../components/controls/Button/ButtonWithIcon";
import {Divider} from "../components/StyledComponents/Divider";
import {Close} from '../components/StyledComponents/Icon'
import {FlexBlock} from '../components/StyledComponents/FlexBlock'
import {Text} from "../components/StyledComponents/Text";
import RegEmail from '../components/Auth/RegEmail'
import GoogleLoginBtn from '../components/Auth/GoogleLoginBtn'
import FacebookLoginBtn from '../components/Auth/FacebookLoginBtn'

const RegistrationPage = () => {
    const [viewRegEmail, setView] = useState(false)

    return (
        <>
            <Wrapper p={25}>
                {viewRegEmail?
                    <RegEmail setView={setView} />
                    :
                    <>
                        <Wrapper mb={35}>
                            <Close onClick={() => Router.back()} />
                        </Wrapper>

                        <GoogleLoginBtn />
                        <FacebookLoginBtn />

                        <FlexBlock>
                            <Divider grey full/>
                            <Text>or</Text>
                            <Divider grey full/>
                        </FlexBlock>
                        <ButtonWithIcon email mt={10} onClick={() => setView(true)} >Register with E-mail</ButtonWithIcon>
                        <Divider grey full mt={20} mb={16} />
                        <FlexBlock>
                            <Text>Already signed up?</Text>
                            <Link href={'/login'}>
                                <Text isLink >Log in</Text>
                            </Link>
                        </FlexBlock>
                    </>
                }
            </Wrapper>

        </>
    );
};

export default RegistrationPage;
